
CREATE DATABASE IF NOT EXISTS cities_db;
USE cities_db;
CREATE TABLE IF NOT EXISTS Countries (
    id int NOT NULL AUTO_INCREMENT,
    name varchar(255) NOT NULL,
    PRIMARY KEY (id)
);
CREATE TABLE IF NOT EXISTS States (
    id int NOT NULL AUTO_INCREMENT,
    name varchar(255) NOT NULL,
    country_id int,
    PRIMARY KEY (id)
);
CREATE TABLE IF NOT EXISTS Cities (
    id int NOT NULL AUTO_INCREMENT,
    name varchar(255) NOT NULL,
    state_id int,
    population int,
    PRIMARY KEY (id)
);

